import React from 'react'
import styled from "styled-components"

const Container = styled.div`
    width: 100%;
    height: 80px;
    background-color: #F6F9FC;
`

const ContentContainer = styled.div`
    width: 1100px;
    padding-top: 30px;
`

export default function NavBar () {
    return (
    <Container>
            <div classname="content-container">
                <h4 className="name"><span className="name-bold">Ben</span> DiMarco <span class="emoji">ðŸ‘‹</span></h4>
                <div className="nav-link-container">
                    <ul className="nav-link-list">
                        <li className="nav-link"><a className="nav-btn">About Me</a></li>
                        <li className="nav-link"><a className="nav-btn">My Projects</a></li>
                        <li className="nav-link"><a className="nav-btn">Get In Touch</a></li>
                        <li className="nav-link"><a className="nav-btn">O</a></li>
                    </ul>
                </div>
            </div>
        </Container>
    )
}
